(2, 1, 12, 'On accède à un wiki, en lecture comme en écriture, avec un navigateur web classique. On peut visualiser les pages dans deux modes différents : le mode lecture, qui est le mode par défaut, et le mode écriture, qui présente la page sous une forme qui permet de la modifier. Seules les informations générales de navigation servant de modèle à la structure de la page ne sont pas modifiables. En mode écriture, le texte de la page, affiché dans un formulaire web, s\'enrichit d\'un certain nombre de caractères supplémentaires, suivant les règles d\'une syntaxe informatique particulière : le wikitexte, qui permet d\'indiquer la mise en forme du texte, de créer des liens, de disposer des images, etc. Le wikitexte a été conçu pour que les fonctionnalités les plus courantes soient faciles à assimiler et saisir10. Depuis 2013, MediaWiki, le moteur de Wikipédia, propose également, au lieu du wikitexte, une interface d\'édition WYSIWYG.', '{\"assets\":[],\"styles\":[{\"selectors\":[\"#my-wrapper\"],\"style\":{\"width\":\"900px\",\"margin-right\":\"auto\",\"margin-left\":\"auto\",\"padding-top\":\"25px\",\"padding-right\":\"35px\",\"padding-bottom\":\"25px\",\"padding-left\":\"35px\",\"margin-top\":\"15px\",\"margin-bottom\":\"15px\",\"border-top-width\":\"1px\",\"border-right-width\":\"1px\",\"border-bottom-width\":\"1px\",\"border-left-width\":\"1px\",\"border-top-style\":\"solid\",\"border-right-style\":\"solid\",\"border-bottom-style\":\"solid\",\"border-left-style\":\"solid\",\"border-top-color\":\"rgb(204, 204, 204)\",\"border-right-color\":\"rgb(204, 204, 204)\",\"border-bottom-color\":\"rgb(204, 204, 204)\",\"border-left-color\":\"rgb(204, 204, 204)\",\"border-image-source\":\"initial\",\"border-image-slice\":\"initial\",\"border-image-width\":\"initial\",\"border-image-outset\":\"initial\",\"border-image-repeat\":\"initial\",\"background-color\":\"rgb(255, 255, 255)\",\"min-height\":\"1000px\"}},{\"selectors\":[\"#my-wrapper\"],\"style\":{\"direction\":\"rtl\"}}],\"pages\":[{\"frames\":[{\"component\":{\"type\":\"wrapper\",\"stylable\":[\"background\",\"background-color\",\"background-image\",\"background-repeat\",\"background-attachment\",\"background-position\",\"background-size\"],\"attributes\":{\"id\":\"my-wrapper\"},\"components\":[{\"tagName\":\"p\",\"type\":\"text\",\"attributes\":{\"id\":\"isaw\"},\"components\":[{\"type\":\"textnode\",\"content\":\"On acc\\u00e8de \\u00e0 un wiki, en lecture comme en \\u00e9criture, avec un navigateur web classique. On peut visualiser les pages dans deux modes diff\\u00e9rents : le mode lecture, qui est le mode par d\\u00e9faut, et le mode \\u00e9criture, qui pr\\u00e9sente la page sous une forme qui permet de la modifier. Seules les informations g\\u00e9n\\u00e9rales de navigation servant de mod\\u00e8le \\u00e0 la structure de la page ne sont pas modifiables. En mode \\u00e9criture, le texte de la page, affich\\u00e9 dans un formulaire web, s\'enrichit d\'un certain nombre de caract\\u00e8res suppl\\u00e9mentaires, suivant les r\\u00e8gles d\'une syntaxe informatique particuli\\u00e8re : le wikitexte, qui permet d\'indiquer la mise en forme du texte, de cr\\u00e9er des liens, de disposer des images, etc. Le wikitexte a \\u00e9t\\u00e9 con\\u00e7u pour que les fonctionnalit\\u00e9s les plus courantes soient faciles \\u00e0 assimiler et saisir10. Depuis 2013, MediaWiki, le moteur de Wikip\\u00e9dia, propose \\u00e9galement, au lieu du wikitexte, une interface d\'\\u00e9dition WYSIWYG.\"}]}]},\"id\":\"ag9oKrdL4Da0fxSO\"}],\"id\":\"XVZ1WyCux1YH1MNC\"}]}', '2024-10-27 00:58:15', '2024-10-27 00:58:15'),
