(4, 1, 13, 'Just as we use variables in a higher level languages, it is useful if we can store data temporarily during a particular routine. All x86 CPUs have four general purpose registers, ax, bx, cx, and dx, for exactly that purpose. Also, these registers, which can each hold a word (two bytes, 16 bits) of data, can be read and written by the CPU with negligible delay as compared with accessing main memory. In assembly programs, one of the most common operations is moving (or more accurately, copying) data between these registers: mov ax , 1234 ; store the decimal number 1234 in ax mov cx , 0 x234 ; store the hex number 0 x234 in cx mov dx , ’t ’ ; store the ASCII code for letter ’t’ in dx mov bx , ax ; copy the value of ax into bx , so now bx == 1234 Notice that the destination is the first and not second argument of the mov operation, but this convention varies with different assemblers. Sometimes it is more convenient to work with single bytes, so these registers let us set their high and low bytes independently: mov ax , 0 ; ax -> 0x0000 , or in binary 0000000000000000 mov ah , 0 x56 ; ax -> 0 x5600 mov al , 0 x23 ; ax -> 0 x5623 mov ah , 0 x16 ; ax -> 0 x1623', '{\"assets\":[],\"styles\":[{\"selectors\":[\"#my-wrapper\"],\"style\":{\"width\":\"900px\",\"margin-right\":\"auto\",\"margin-left\":\"auto\",\"padding-top\":\"25px\",\"padding-right\":\"35px\",\"padding-bottom\":\"25px\",\"padding-left\":\"35px\",\"margin-top\":\"15px\",\"margin-bottom\":\"15px\",\"border-top-width\":\"1px\",\"border-right-width\":\"1px\",\"border-bottom-width\":\"1px\",\"border-left-width\":\"1px\",\"border-top-style\":\"solid\",\"border-right-style\":\"solid\",\"border-bottom-style\":\"solid\",\"border-left-style\":\"solid\",\"border-top-color\":\"rgb(204, 204, 204)\",\"border-right-color\":\"rgb(204, 204, 204)\",\"border-bottom-color\":\"rgb(204, 204, 204)\",\"border-left-color\":\"rgb(204, 204, 204)\",\"border-image-source\":\"initial\",\"border-image-slice\":\"initial\",\"border-image-width\":\"initial\",\"border-image-outset\":\"initial\",\"border-image-repeat\":\"initial\",\"background-color\":\"rgb(255, 255, 255)\",\"min-height\":\"1000px\"}},{\"selectors\":[\"#my-wrapper\"],\"style\":{\"direction\":\"rtl\"}}],\"pages\":[{\"frames\":[{\"component\":{\"type\":\"wrapper\",\"stylable\":[\"background\",\"background-color\",\"background-image\",\"background-repeat\",\"background-attachment\",\"background-position\",\"background-size\"],\"attributes\":{\"id\":\"my-wrapper\"},\"components\":[{\"tagName\":\"p\",\"type\":\"text\",\"attributes\":{\"id\":\"isaw\"},\"components\":[{\"type\":\"textnode\",\"content\":\"Just as we use variables in a higher level languages, it is useful if we can store data temporarily during a particular routine. All x86 CPUs have four general purpose registers, ax, bx, cx, and dx, for exactly that purpose. Also, these registers, which can each hold a word (two bytes, 16 bits) of data, can be read and written by the CPU with negligible delay as compared with accessing main memory. In assembly programs, one of the most common operations is moving (or more accurately, copying) data between these registers: mov ax , 1234 ; store the decimal number 1234 in ax mov cx , 0 x234 ; store the hex number 0 x234 in cx mov dx , \\u2019t \\u2019 ; store the ASCII code for letter \\u2019t\\u2019 in dx mov bx , ax ; copy the value of ax into bx , so now bx == 1234 Notice that the destination is the first and not second argument of the mov operation, but this convention varies with different assemblers. Sometimes it is more convenient to work with single bytes, so these registers let us set their high and low bytes independently: mov ax , 0 ; ax -> 0x0000 , or in binary 0000000000000000 mov ah , 0 x56 ; ax -> 0 x5600 mov al , 0 x23 ; ax -> 0 x5623 mov ah , 0 x16 ; ax -> 0 x1623\"}]}]},\"id\":\"ag9oKrdL4Da0fxSO\"}],\"id\":\"XVZ1WyCux1YH1MNC\"}]}', '2024-11-01 15:51:42', '2024-11-01 15:51:42'),
