(6, 1, 17, 'CodeMirror uses plain numbers to address positions in the document. These represent character counts—more precisely, they count UTF16 code units (so astral characters count as two units). Line breaks always count as a single unit (even when you configure a line separator that is longer than that). These offsets are used to track the selection, position changes, decorate content, and so on. It is sometimes necessary to figure out where a position in a start document ends up in a changed document. For this purpose, the library provides a position mapping feature, which, given a transaction (or just a change set) and a start position, can give you the corresponding new position.\n', '{\"assets\":[],\"styles\":[{\"selectors\":[\"#editor-wrapper\"],\"style\":{\"width\":\"900px\",\"margin-right\":\"auto\",\"margin-left\":\"auto\",\"padding-top\":\"25px\",\"padding-right\":\"35px\",\"padding-bottom\":\"25px\",\"padding-left\":\"35px\",\"margin-top\":\"15px\",\"margin-bottom\":\"15px\",\"border-top-width\":\"1px\",\"border-right-width\":\"1px\",\"border-bottom-width\":\"1px\",\"border-left-width\":\"1px\",\"border-top-style\":\"solid\",\"border-right-style\":\"solid\",\"border-bottom-style\":\"solid\",\"border-left-style\":\"solid\",\"border-top-color\":\"rgb(204, 204, 204)\",\"border-right-color\":\"rgb(204, 204, 204)\",\"border-bottom-color\":\"rgb(204, 204, 204)\",\"border-left-color\":\"rgb(204, 204, 204)\",\"border-image-source\":\"initial\",\"border-image-slice\":\"initial\",\"border-image-width\":\"initial\",\"border-image-outset\":\"initial\",\"border-image-repeat\":\"initial\",\"background-color\":\"rgb(255, 255, 255)\",\"min-height\":\"1000px\"}},{\"selectors\":[\"#my-wrapper\"],\"style\":{\"direction\":\"rtl\"}}],\"pages\":[{\"frames\":[{\"component\":{\"type\":\"wrapper\",\"stylable\":[\"background\",\"background-color\",\"background-image\",\"background-repeat\",\"background-attachment\",\"background-position\",\"background-size\"],\"attributes\":{\"id\":\"my-wrapper\"},\"components\":[{\"tagName\":\"p\",\"type\":\"text\",\"attributes\":{\"id\":\"isaw\"},\"components\":[{\"type\":\"textnode\",\"content\":\"CodeMirror uses plain numbers to address positions in the document. These represent character counts\\u2014more precisely, they count UTF16 code units (so astral characters count as two units). Line breaks always count as a single unit (even when you configure a line separator that is longer than that). These offsets are used to track the selection, position changes, decorate content, and so on. It is sometimes necessary to figure out where a position in a start document ends up in a changed document. For this purpose, the library provides a position mapping feature, which, given a transaction (or just a change set) and a start position, can give you the corresponding new position.\\n\"}]}]},\"id\":\"ag9oKrdL4Da0fxSO\"}],\"id\":\"XVZ1WyCux1YH1MNC\"}]}', '2024-11-24 21:48:19', '2024-11-24 21:48:19'),
(7, 1, 17, 'Each component triggers different lifecycle hooks, which allows you to add custom actions at their specific stages. We can distinguish 2 different types of hooks: global and local. You define local hooks when you create/extend a component type (usually via some model/view method) and the reason is to react to an event of that particular component type. Instead, the global one, will be called indistinctly on any component (you listen to them via editor.on) and you can make use of them for a more generic use case or also listen to them inside other components. Let\'s see below the flow of all hooks: Local hook: model.init() method, executed once the model of the component is initialized Global hook: component:create event, called right after model.init(). The model is passed as an argument to the callback function. Es. editor.on(\'component:create\', model => console.log(\'created\', model)) Local hook: view.init() method, executed once the view of the component is initialized Local hook: view.onRender() method, executed once the component is rendered on the canvas Global hook: component:mount event, called right after view.onRender(). The model is passed as an argument to the callback function. Local hook: model.updated() method, executes when some property of the model is updated. Global hook: component:update event, called after model.updated(). The model is passed as an argument to the callback function. You can also listen to specific property change via component:update:{propertyName} Local hook: model.removed() method, executed when the component is removed. Global hook: component:remove event, called after model.removed(). The model is passed as an argument to the callback function. Below you can find an example usage of all the hooks\nEach component triggers different lifecycle hooks, which allows you to add custom actions at their specific stages. We can distinguish 2 different types of hooks: global and local. You define local hooks when you cre