(8, 1, 19, 'uality of experience: It aims to play the best possible quality without any re-buffering. Unsupported codecs and undecipherable qualities (e.g. higher qualities with more drastic DRM conditions on untrusted devices) are automatically filtered out, even if this happens during playback. The player is also very resilient: any temporary network issue, fall in bandwidth, poorly-packaged content or platform quirk should be properly handled with the main goal of avoiding playback interruption. Portability: The RxPlayer has been ported to a lot of devices, some on the lower-end of performance and memory capabilities and others on the higher end. As such, it can adapt to important memory and performance constraints while still being able to retain its many features. Configurability: The RxPlayer has a plethora of options to let you tweak its behavior. You should be able to play any content the way you want, on any device.\n', '{\"assets\":[],\"styles\":[{\"selectors\":[\"#editor-wrapper\"],\"style\":{\"width\":\"900px\",\"margin-right\":\"auto\",\"margin-left\":\"auto\",\"padding-top\":\"25px\",\"padding-right\":\"35px\",\"padding-bottom\":\"25px\",\"padding-left\":\"35px\",\"margin-top\":\"15px\",\"margin-bottom\":\"15px\",\"border-top-width\":\"1px\",\"border-right-width\":\"1px\",\"border-bottom-width\":\"1px\",\"border-left-width\":\"1px\",\"border-top-style\":\"solid\",\"border-right-style\":\"solid\",\"border-bottom-style\":\"solid\",\"border-left-style\":\"solid\",\"border-top-color\":\"rgb(204, 204, 204)\",\"border-right-color\":\"rgb(204, 204, 204)\",\"border-bottom-color\":\"rgb(204, 204, 204)\",\"border-left-color\":\"rgb(204, 204, 204)\",\"border-image-source\":\"initial\",\"border-image-slice\":\"initial\",\"border-image-width\":\"initial\",\"border-image-outset\":\"initial\",\"border-image-repeat\":\"initial\",\"background-color\":\"rgb(255, 255, 255)\",\"min-height\":\"1000px\"}},{\"selectors\":[\"#my-wrapper\"],\"style\":{\"direction\":\"rtl\"}}],