(9, 1, 19, 'xgplayer is a web video player library. It has designed a separate, detachable UI component based on the principle that everything is componentized. More importantly, it is not only flexible in the UI layer, but also bold in its functionality: it gets rid of video loading, buffering, and format support for video dependence. Especially on mp4 it can be staged loading for that does not support streaming mp4. This means seamless switching with clarity, load control, and video savings. It also integrates on-demand and live support for FLV, HLS, and dash. Document xgplayer provides more plugins and supports custom plugins, for more content viewing plugins. There are many built-in plugins in the player, if you need to close specific plugins, you can disable them by ignores configuration Dev In order to debug by developers, we provide demos code in the fixtures directory of the repo. The player uses yarn for package management, and it only takes a few simple steps to start debugging in the repo $ cd xgplayer $ yarn $ yarn dev:xgplayer To debug other plugins, please refer to the scripts command provided in package.json in the root directory of the repo, such as: $ yarn dev:hls $ yarn dev:flv $ yarn dev:mp4 License Welcome to use xgplayer! Please read the following terms carefully. Using xgplayer means that you accept and agree to the terms. Xgplayer is licensed under the MIT License. You comply with its obligations by default. By default, you authorize us to place your logo in xgplayer website, which using xgplayer. If you have any problem, please let us know.', '{\"assets\":[],\"styles\":[{\"selectors\":[\"#editor-wrapper\"],\"style\":{\"width\":\"900px\",\"margin-right\":\"auto\",\"margin-left\":\"auto\",\"padding-top\":\"25px\",\"padding-right\":\"35px\",\"padding-bottom\":\"25px\",\"padding-left\":\"35px\",\"margin-top\":\"15px\",\"margin-bottom\":\"15px\",\"border-top-width\":\"1px\",\"border-right-width\":\"1px\",\"border-bottom-width\":\"1px\",\"border-le