takes a few simple steps to start debugging in the repo $ cd xgplayer $ yarn $ yarn dev:xgplayer To debug other plugins, please refer to the scripts command provided in package.json in the root directory of the repo, such as: $ yarn dev:hls $ yarn dev:flv $ yarn dev:mp4 License Welcome to use xgplayer! Please read the following terms carefully. Using xgplayer means that you accept and agree to the terms. Xgplayer is licensed under the MIT License. You comply with its obligations by default. By default, you authorize us to place your logo in xgplayer website, which using xgplayer. If you have any problem, please let us know.\"}]}]},\"id\":\"ag9oKrdL4Da0fxSO\"}],\"id\":\"XVZ1WyCux1YH1MNC\"}]}', '2024-11-26 13:01:42', '2024-11-26 13:01:42'),
(10, 1, 19, 'Note that depending on how they are used, badges may be confusing for users of screen readers and similar assistive technologies. While the styling of badges provides a visual cue as to their purpose, these users will simply be presented with the content of the badge. Depending on the specific situation, these badges may seem like random additional words or numbers at the end of a sentence, link, or button.\n\nUnless the context is clear (as with the “Notifications” example, where it is understood that the “4” is the number of notifications), consider including additional context with a visually hidden piece of additional text.', '{\"assets\":[],\"styles\":[{\"selectors\":[\"#editor-wrapper\"],\"style\":{\"width\":\"900px\",\"margin-right\":\"auto\",\"margin-left\":\"auto\",\"padding-top\":\"25px\",\"padding-right\":\"35px\",\"padding-bottom\":\"25px\",\"padding-left\":\"35px\",\"margin-top\":\"15px\",\"margin-bottom\":\"15px\",\"border-top-width\":\"1px\",\"border-right-width\":\"1px\",\"border-bottom-width\":\"1px\",\"border-left-width\":\"1px\",\"border-top-style\":\"solid\",\"border-right-style\":\"solid\",\"border-bottom-style\":\"solid\",\"border-left-style\":\"solid\",\"border-top-color\":\"rgb(204, 204, 204)\",\"border-right-color\":\"rgb(204, 204, 204)\",\"border-bottom-color\":\"rgb(204, 204, 204)\",\"border-left-color\":\"rgb(204, 204, 204)\",\"border-image-source\":\"initial\",\"border-image-slice\":\"initial\",\"border-image-width\":\"initial\",\"border-image-outset\":\"initial\",\"border-image-repeat\":\"initial\",\"background-color\":\"rgb(255, 255, 255)\",\"min-height\":\"1000px\"}},{\"selectors\":[\"#my-wrapper\"],\"style\":{\"direction\":\"rtl\"}}],\"pages\":[{\"frames\":[{\"component\":{\"type\":\"wrapper\",\"stylable\":[\"background\",\"background-color\",\"background-image\",\"background-repeat\",\"background-attachment\",\"background-position\",\"background-size\"],\"attributes\":{\"id\":\"my-wrapper\"},\"components\":[{\"tagName\":\"p\",\"type\":\"text\",\"attributes\":{\"id\":\"isaw\"},\"components\":[{\"type\":\"textnode\",\"content\":\"Note that depending on how they are used, badges may be confusing for users of screen readers and similar assistive technologies. While the styling of badges provides a visual cue as to their purpose, these users will simply be presented with the content of the badge. Depending on the specific situation, these badges may seem like random additional words or numbers at the end of a sentence, link, or button.\\n\\nUnless the context is clear (as with the \\u201cNotifications\\u201d example, where it is understood that the \\u201c4\\u201d is the number of notifications), consider including additional context with a visually hidden piece of additional text.\"}]}]},\"id\":\"ag9oKrdL4Da0fxSO\"}],\"id\":\"XVZ1WyCux1YH1MNC\"}]}', '2024-11-28 00:36:30', '2024-11-28 00:36:30'),
