id\":\"iiotk\"}}]},{\"type\":\"text\",\"attributes\":{\"id\":\"ie85\"},\"components\":[{\"type\":\"textnode\",\"content\":\"CodeMirror uses plain numbers to address positions in the document. These represent character counts—more precisely, they count UTF16 code units (so astral characters count as two units). Line breaks always count as a single unit (even when you configure a line separator that is longer than that). These \"},{\"tagName\":\"b\",\"type\":\"text\",\"components\":[{\"type\":\"textnode\",\"content\":\"offsets \"}]},{\"type\":\"textnode\",\"content\":\"are used to track the selection, position changes, decorate content, and so on. It is sometimes necessary to figure out where a position in a start document ends up in a changed \"},{\"tagName\":\"span\",\"type\":\"text\",\"attributes\":{\"id\":\"i8s42\"},\"components\":[{\"type\":\"textnode\",\"content\":\"document\"}]},{\"type\":\"textnode\",\"content\":\". For this purpose, the library provides a \"},{\"tagName\":\"b\",\"type\":\"text\",\"components\":[{\"type\":\"textnode\",\"content\":\"position \"}]},{\"type\":\"textnode\",\"content\":\"mapping feature, which, given a transaction (or just a change set) and a start position, can give you the \"},{\"tagName\":\"span\",\"type\":\"text\",\"attributes\":{\"id\":\"iugo9\"},\"components\":[{\"type\":\"textnode\",\"content\":\"corresponding \"}]},{\"type\":\"textnode\",\"content\":\"new position.\"}]},{\"type\":\"text\",\"attributes\":{\"id\":\"ii9dj\"},\"components\":[{\"type\":\"textnode\",\"content\":\"So, Please Enjoy the video :\"}]},{\"type\":\"video\",\"resizable\":{\"ratioDefault\":1},\"style\":\"\",\"attributes\":{\"allowfullscreen\":\"allowfullscreen\",\"id\":\"iueyc\"},\"src\":\"http://dev-progra.com/pdriver/skiboard-673a6f1e0c00d.mp4\",\"sources\":[]},{\"type\":\"two-columns\",\"style\":\"\",\"classes\":[\"row\"],\"attributes\":{\"id\":\"iiwmm\"},\"components\":[{\"content\":\"Column 1\",\"attributes\":{\"id\":\"column-1\"},\"components\":[{\"type\":\"text\",\"attributes\":{\"id\":\"igjna\"},\"components\":[{\"type\":\"textnode\",\"content\":\"Open-source JavaScript and HTML5 video player libraries are a popular choice for developers looking to add video playback functionality to their web applications. These libraries provide a customizable and flexible solution that can be integrated easily into a variety of projects.\"}]}]},{\"content\":\"Column 2\",\"attributes\":{\"id\":\"column-2\"},\"components\":[{\"type\":\"text\",\"attributes\":{\"id\":\"i2vix\"},\"components\":[{\"type\":\"textnode\",\"content\":\"Stability: The RxPlayer can play live and On Demand DASH and Smooth contents for extended amounts of time, with or without DRM - without any performance, memory or logic issue. If you encounter a new issue while using it, we\'ll be very happy to help fixing it. Any encountered bug is put at high priority.\"}]}]},{\"content\":\"Column 2\",\"attributes\":{\"id\":\"i0e6n\"},\"components\":[{\"type\":\"text\",\"attributes\":{\"id\":\"it16n\"},\"components\":[{\"type\":\"textnode\",\"content\":\"The player is also very resilient: any temporary network issue, fall in bandwidth, poorly-packaged content or platform quirk should be properly handled with the main goal of avoiding playback interruption.\"}]}]}]},{\"tagName\":\"ul\",\"attributes\":{\"id\":\"i1ihx\"},\"components\":[{\"tagName\":\"li\",\"type\":\"text\",\"attributes\":{\"id\":\"icixi\"},\"components\":[{\"type\":\"textnode\",\"content\":\"nfigure a line separator that is longer than that\"}]},{\"tagName\":\"li\",\"type\":\"text\",\"attributes\":{\"id\":\"iepbf\"},\"components\":[{\"type\":\"textnode\",\"content\":\"ends up in a changed document.\"}]},{\"tagName\":\"li\",\"type\":\"text\",\"attributes\":{\"id\":\"i0z7d\"},\"components\":[{\"type\":\"textnode\",\"content\":\"plain numbers to address positions in the document\"}]}]},{\"type\":\"code\",\"attributes\":{\"id\":\"if9p\",\"language\":\"javascript\"},\"codeContent\":\"import {basicSetup, EditorView} from \\\"codemirror\\\"\\n\\nimport {autocompletion} from \\\"@codemirror/autocomplete\\\"\\n\\n\\n// Our list of completions (can be static, since the editor\\n/// will do filtering based on context).\\nconst completions = [\\n  {label: \\\"panic\\\", type: \\\"keyword\\\"},\\n  {label: \\\"park\\\", type: \\\"constant\\\", info: \\\"Test completion\\\"},\\n  {label: \\\"password\\\", type: \\\"variable\\\"},\\n]\\n\\nfunction myCompletions(context) {\\n  let before = context.matchBefore(/\\\\w+/)\\n  // If completion wasn\'t explicitly started and there\\n  // is no word before the cursor, don\'t open completions.\\n  if (!context.explicit && !before) return null\\n  return {\\n    from: before ? before.from : context.pos,\\n    options: completions,\\n    validFor: /^\\\\w*$/\\n  }\\n}\\nfor (let index = 0; index < bound; index++) {\\n  var x = 5;\\n}\\n\\nlet view = new EditorView({\\n  doc: \\\"// Type a \'p\'\\\\n\\\",\\n  extensions: [\\n    basicSetup,\\n    autocompletion({override: [myCompletions]})\\n  ],\\n  parent: document.body\\n})\",\"codeOutput\":\"import {basicSetup, EditorView} from \\\"codemirror\\\"\\n\\nimport {autocompletion} from \\\"@codemirror/autocomplete\\\"\\n\\n\\n// Our list of completions (can be static, since the editor\\n/// will do filtering based on context).\\nconst completions = [\\n  {label: \\\"panic\\\", type: \\\"keyword\\\"},\\n  {label: \\\"park\\\", type: \\\"constant\\\", info: \\\"Test completion\\\"},\\n  {label: \\\"password\\\", type: \\\"variable\\\"},\\n]\\n\\nfunction myCompletions(context) {\\n  let before = context.matchBefore(/\\\\w+/)\\n  // If completion wasn\'t explicitly started and there\\n  // is no word before the cursor, don\'t open completions.\\n  if (!context.explicit && !before) return null\\n  return {\\n    from: before ? before.from : context.pos,\\n    options: completions,\\n    validFor: /^\\\\w*$/\\n  }\\n}\\nfor (let index = 0; index &lt; bound; index++) {\\n  var x = 5;\\n}\\n\\nlet view = new EditorView({\\n  doc: \\\"// Type a \'p\'\\\\n\\\",\\n  extensions: [\\n    basicSetup,\\n    autocompletion({override: [myCompletions]})\\n  ],\\n  parent: document.body\\n})\"},{\"type\":\"file\",\"attributes\":{\"id\":\"i1c64\"},\"fileUrl\":\"http://dev-progra.com/pdriver/2023-08-20-01-11-26-6725a36975c46.mkv\",\"fileName\":\"2023-08-20 01-11-26.mkv\",\"fileSize\":138402058},{\"tagName\":\"section\",\"attributes\":{\"id\":\"ijq9\"},\"components\":[{\"tagName\":\"h1\",\"type\":\"text\",\"attributes\":{\"id\":\"ioija\"},\"components\":[{\"type\":\"textnode\",\"content\":\"This is a simple title\"}]},{\"type\":\"text\",\"attributes\":{\"id\":\"iub0t\"},\"components\":[{\"type\":\"textnode\",\"content\":\"Each component triggers different lifecycle hooks, which allows you to add custom actions at their specific stages. We can distinguish 2 different types of hooks: global and local. You define local hooks when you create/extend a component type (usually via some model/view method) and the reason is to react to an event of that particular component type. Instead, the global one, will be called indistinctly on any component (you listen to them via editor.on) and you can make use of them for a more generic use case or also listen to them inside other components. Let\'s see below the flow of all hooks: Local hook: model.init() method, executed once the model of the component is initialized Global hook: component:create event, called right after model.init(). The model is passed as an argument to the callback function. Es. editor.on(\'component:create\', model => console.log(\'created\', model)) Local hook: view.init() method, executed once the view of the component is initialized Local hook: view.onRender() method, executed once the component is rendered on the canvas Global hook: component:mount event, called right after view.onRender(). The model is passed as an argument to the callback function. Local hook: model.updated() method, executes when some property of the model is updated. Global hook: component:update event, called after model.updated(). The model is passed as an argument to the callback function. You can also listen to specific property change via component:update:{propertyName} Local hook: model.removed() method, executed when the component is removed. Global hook: component:remove event, called after model.removed(). The model is passed as an argument to the callback function. Below you can find an example usage of all the hooks\"}]}]},{\"type\":\"table\",\"droppable\":[\"tbody\",\"thead\",\"tfoot\"],\"style\":\"\",\"attributes\":{\"id\":\"id62\"},\"components\":[{\"type\":\"thead\",\"draggable\":[\"table\"],\"droppable\":[\"tr\"],\"attributes\":{\"id\":\"ikdtf\"},\"components\":[{\"type\":\"row\",\"draggable\":[\"thead\",\"tbody\",\"tfoot\"],\"droppable\":[\"th\",\"td\"],\"components\":[{\"tagName\":\"th\",\"type\":\"cell\",\"draggable\":[\"tr\"],\"attributes\":{\"id\":\"iko9\"},\"components\":[{\"type\":\"textnode\",\"content\":\"Header 1\"}]},{\"tagName\":\"th\",\"type\":\"cell\",\"draggable\":[\"tr\"],\"attributes\":{\"id\":\"io1p\"},\"components\":[{\"type\":\"textnode\",\"content\":\"Header 2\"}]},{\"tagName\":\"th\",\"type\":\"cell\",\"draggable\":[\"tr\"],\"attributes\":{\"id\":\"igzu9\"},\"components\":[{\"type\":\"textnode\",\"content\":\"Header 3\"}]}]}]},{\"type\":\"tbody\",\"draggable\":[\"table\"],\"droppable\":[\"tr\"],\"attributes\":{\"id\":\"itbq1\"},\"components\":[{\"type\":\"row\",\"draggable\":[\"thead\",\"tbody\",\"tfoot\"],\"droppable\":[\"th\",\"td\"],\"components\":[{\"type\":\"cell\",\"draggable\":[\"tr\"],\"attributes\":{\"id\":\"it76h\"},\"components\":[{\"type\":\"textnode\",\"content\":\"Row 1 Col 1\"}]},{\"type\":\"cell\",\"draggable\":[\"tr\"],\"attributes\":{\"id\":\"i6zc5\"},\"components\":[{\"type\":\"textnode\",\"content\":\"Row 1 Col 2\"}]},{\"type\":\"cell\",\"draggable\":[\"tr\"],\"attributes\":{\"id\":\"ivw76\"},\"components\":[{\"type\":\"textnode\",\"content\":\"Row 1 Col 3\"}]}]},{\"type\":\"row\",\"draggable\":[\"thead\",\"tbody\",\"tfoot\"],\"droppable\":[\"th\",\"td\"],\"components\":[{\"type\":\"cell\",\"draggable\":[\"tr\"],\"attributes\":{\"id\":\"i2l5g\"},\"components\":[{\"type\":\"textnode\",\"content\":\"Row 2 Col 1\"}]},{\"type\":\"cell\",\"draggable\":[\"tr\"],\"attributes\":{\"id\":\"in2hf\"},\"components\":[{\"type\":\"textnode\",\"content\":\"Row 2 Col 2\"}]},{\"type\":\"cell\",\"draggable\":[\"tr\"],\"attributes\":{\"id\":\"izz39\"},\"components\":[{\"type\":\"textnode\",\"content\":\"Row 2 Col 3\"}]}]}]}]},{\"type\":\"code\",\"attributes\":{\"id\":\"io15l\",\"language\":\"javascript\"},\"codeContent\":\"\\n\",\"codeOutput\":\"\\n\"},{\"tagName\":\"section\",\"components\":[{\"tagName\":\"h1\",\"type\":\"text\",\"attributes\":{\"id\":\"ijtzw\"},\"components\":[{\"type\":\"textnode\",\"content\":\"This is a simple title\"}]},{\"type\":\"text\",\"attributes\":{\"id\":\"ianzt\"},\"components\":[{\"type\":\"textnode\",\"content\":\"This is just a Lorem text: Lorem ipsum dolor sit amet\"}]}]},{\"type\":\"code\",\"attributes\":{\"id\":\"i2u1w\",\"language\":\"php\"},\"codeContent\":\"<?php\\n/*\\n * Copyright © ProgramCMS. All rights reserved.\\n * See COPYING.txt for license details.\\n *\\n * Developed by Mohamed EL QUCHIRI <elquchiri@gmail.com>\\n */\\n\\nnamespace ProgramCms\\\\PostBundle\\\\Controller\\\\Adminhtml\\\\Index;\\n\\nuse Exception;\\nuse ProgramCms\\\\CoreBundle\\\\Controller\\\\AdminController;\\nuse ProgramCms\\\\CoreBundle\\\\Controller\\\\Context;\\nuse ProgramCms\\\\CoreBundle\\\\Model\\\\ObjectManager;\\nuse ProgramCms\\\\CoreBundle\\\\View\\\\Result\\\\Page;\\nuse ProgramCms\\\\PostBundle\\\\Repository\\\\PostRepository;\\nuse ProgramCms\\\\UiBundle\\\\Component\\\\Form\\\\Element\\\\Hidden;\\nuse ReflectionException;\\n\\n/**\\n * Class EditController\\n * @package ProgramCms\\\\PostBundle\\\\Controller\\\\Adminhtml\\\\Index\\n */\\nclass EditController extends AdminController\\n{\\n    /**\\n     * @var ObjectManager\\n     */\\n    protected ObjectManager $objectManager;\\n\\n    /**\\n     * @var PostRepository\\n     */\\n    protected PostRepository $postRepository;\\n\\n    /**\\n     * EditController constructor.\\n     * @param Context $context\\n     * @param ObjectManager $objectManager\\n     * @param PostRepository $postRepository\\n     */\\n    public function __construct(\\n        Context $context,\\n        ObjectManager $objectManager,\\n        PostRepository $postRepository\\n    )\\n    {\\n        parent::__construct($context);\\n        $this->objectManager = $objectManager;\\n        $this->postRepository = $postRepository;\\n    }\\n\\n    /**\\n     * @return object\\n     * @throws ReflectionException\\n     */\\n    public function execute(): object\\n    {\\n        $postId = $this->getRequest()->getParam(\'id\');\\n        /** @var Page $pageResult */\\n        $pageResult = $this->objectManager->create(Page::class);\\n        if($postId) {\\n            $post = $this->postRepository->getById($postId);\\n            $pageResult->getConfig()->getTitle()->set(\\n                $this->trans($post->getPostName())\\n            );\\n        }\\n\\n        $this->prepareLayout($pageResult);\\n\\n        return $pageResult;\\n    }\\n\\n    /**\\n     * @param Page $pageResult\\n     * @throws Exception\\n     */\\n    protected function prepareLayout(Page $pageResult)\\n    {\\n        $layout = $pageResult->getLayout();\\n        $request = $this->getRequest();\\n        $formBlock = $layout->getBlock(\'post_form\');\\n        $hiddenWebsiteViewScope = $layout->createBlock(Hidden::class, \'website_view\', [\\n            \'value\' => $request->getParam(\'website_view\')\\n        ]);\\n        $formBlock->setChild(\'website_view\', $hiddenWebsiteViewScope);\\n    }\\n}\",\"codeOutput\":\"&lt;?php\\n/*\\n * Copyright © ProgramCMS. All rights reserved.\\n * See COPYING.txt for license details.\\n *\\n * Developed by Mohamed EL QUCHIRI &lt;elquchiri@gmail.com&gt;\\n */\\n\\nnamespace ProgramCms\\\\PostBundle\\\\Controller\\\\Adminhtml\\\\Index;\\n\\nuse Exception;\\nuse ProgramCms\\\\CoreBundle\\\\Controller\\\\AdminController;\\nuse ProgramCms\\\\CoreBundle\\\\Controller\\\\Context;\\nuse ProgramCms\\\\CoreBundle\\\\Model\\\\ObjectManager;\\nuse ProgramCms\\\\CoreBundle\\\\View\\\\Result\\\\Page;\\nuse ProgramCms\\\\PostBundle\\\\Repository\\\\PostRepository;\\nuse ProgramCms\\\\UiBundle\\\\Component\\\\Form\\\\Element\\\\Hidden;\\nuse ReflectionException;\\n\\n/**\\n * Class EditController\\n * @package ProgramCms\\\\PostBundle\\\\Controller\\\\Adminhtml\\\\Index\\n */\\nclass EditController extends AdminController\\n{\\n    /**\\n     * @var ObjectManager\\n     */\\n    protected ObjectManager $objectManager;\\n\\n    /**\\n     * @var PostRepository\\n     */\\n    protected PostRepository $postRepository;\\n\\n    /**\\n     * EditController constructor.\\n     * @param Context $context\\n     * @param ObjectManager $objectManager\\n     * @param PostRepository $postRepository\\n     */\\n    public function __construct(\\n        Context $context,\\n        ObjectManager $objectManager,\\n        PostRepository $postRepository\\n    )\\n    {\\n        parent::__construct($context);\\n        $this-&gt;objectManager = $objectManager;\\n        $this-&gt;postRepository = $postRepository;\\n    }\\n\\n    /**\\n     * @return object\\n     * @throws ReflectionException\\n     */\\n    public function execute(): object\\n    {\\n        $postId = $this-&gt;getRequest()-&gt;getParam(\'id\');\\n        /** @var Page $pageResult */\\n        $pageResult = $this-&gt;objectManager-&gt;create(Page::class);\\n        if($postId) {\\n            $post = $this-&gt;postRepository-&gt;getById($postId);\\n            $pageResult-&gt;getConfig()-&gt;getTitle()-&gt;set(\\n                $this-&gt;trans($post-&gt;getPostName())\\n            );\\n        }\\n\\n        $this-&gt;prepareLayout($pageResult);\\n\\n        return $pageResult;\\n    }\\n\\n    /**\\n     * @param Page $pageResult\\n     * @throws Exception\\n     */\\n    protected function prepareLayout(Page $pageResult)\\n    {\\n        $layout = $pageResult-&gt;getLayout();\\n        $request = $this-&gt;getRequest();\\n        $formBlock = $layout-&gt;getBlock(\'post_form\');\\n        $hiddenWebsiteViewScope = $layout-&gt;createBlock(Hidden::class, \'website_view\', [\\n            \'value\' =&gt; $request-&gt;getParam(\'website_view\')\\n        ]);\\n        $formBlock-&gt;setChild(\'website_view\', $hiddenWebsiteViewScope);\\n    }\\n}\"}]},\"id\":\"D5kwHId0Wyx9sUmc\"}],\"id\":\"wW2g0KIYG4PCViI1\"}]}');
