-6727e8a4c9704.jpg\",\"unitDim\":\"px\",\"height\":\"500px\",\"width\":\"500px\"},{\"type\":\"image\",\"src\":\"http://dev-progra.com/pdriver/42e27dd3e9434ef597473b8a28abdc5c-1-67016bc008cbb-6726d784bd81a.png\",\"unitDim\":\"px\",\"height\":\"500px\",\"width\":\"500px\"},{\"type\":\"image\",\"src\":\"http://dev-progra.com/pdriver/1708171541910-6725a4da3d97b.jpg\",\"unitDim\":\"px\",\"height\":\"500px\",\"width\":\"500px\"},{\"type\":\"image\",\"src\":\"http://dev-progra.com/pdriver/1000013541-6725a4d6108dd.jpg\",\"unitDim\":\"px\",\"height\":\"500px\",\"width\":\"500px\"},{\"type\":\"video\",\"src\":\"http://dev-progra.com/pdriver/2023-08-20-01-11-26-6725a36975c46.mkv\",\"unitDim\":\"px\",\"height\":\"500px\",\"width\":\"500px\"},{\"type\":\"video\",\"src\":\"http://dev-progra.com/pdriver/2023-08-20-01-10-26-6725a197c283e.mkv\",\"unitDim\":\"px\",\"height\":\"500px\",\"width\":\"500px\"},{\"type\":\"file\",\"src\":\"http://dev-progra.com/pdriver/vip-6725a11aad99c.zip\",\"unitDim\":\"px\",\"height\":\"500px\",\"width\":\"500px\"},{\"type\":\"image\",\"src\":\"http://dev-progra.com/pdriver/49557724-5-672597ca469c7.jpg\",\"unitDim\":\"px\",\"height\":\"500px\",\"width\":\"500px\"},{\"type\":\"video\",\"src\":\"http://dev-progra.com/pdriver/2024-07-28-23-15-10-67258261cd0fc-672597bfdd738.mkv\",\"unitDim\":\"px\",\"height\":\"500px\",\"width\":\"500px\"},{\"type\":\"file\",\"src\":\"http://dev-progra.com/pdriver/quotation2024-10-24-11-01-15-672597ae9f945.pdf\",\"unitDim\":\"px\",\"height\":\"500px\",\"width\":\"500px\"}],\"styles\":[{\"selectors\":[\"#my-wrapper\"],\"style\":{\"margin-top\":\"0px\",\"margin-right\":\"auto\",\"margin-bottom\":\"0px\",\"margin-left\":\"auto\",\"min-height\":\"1000px\",\"padding-left\":\"29px !important\",\"padding-right\":\"29px !important\",\"padding-top\":\"23px !important\",\"padding-bottom\":\"23px !important\",\"background-color\":\"rgb(255, 255, 255) !important\"},\"wrapper\":1},{\"selectors\":[\"#my-wrapper\"],\"style\":{\"direction\":\"ltr\"}},{\"selectors\":[\"#iynr\"],\"style\":{\"width\":\"100%\",\"height\":\"100%\"}},{\"selectors\":[\"#if2u\"],\"style\":{\"margin\":\"0px 0px 11px 0px\",\"border\":\"0 solid black\",\"font-family\":\"Arial\"}},{\"selectors\":[\"#ieoxh\"],\"style\":{\"display\":\"flex\",\"width\":\"100%\",\"height\":\"auto\"}},{\"selectors\":[\"#column-1\"],\"style\":{\"flex\":1,\"padding\":\"10px\"}},{\"selectors\":[\"#column-2\"],\"style\":{\"flex\":1,\"padding\":\"10px\"}},{\"selectors\":[\"#ib4qw\"],\"style\":{\"width\":\"84px\",\"height\":\"87px\",\"margin\":\"23px 0px 0px 0px\"}},{\"selectors\":[\"#i814h\"],\"style\":{\"width\":\"122px\",\"height\":\"106px\",\"margin\":\"4px 0px 0px 24px\"}},{\"selectors\":[\"#iohyj\"],\"style\":{\"margin\":\"24px 0px 0px 0px\"}},{\"selectors\":[\"#ibqlv\"],\"style\":{\"width\":\"100%\",\"border\":\"1px solid #ddd\",\"padding\":\"7px\"}},{\"selectors\":[\"#idkij\"],\"style\":{\"border\":\"1px solid #ddd\",\"padding\":\"8px\"}},{\"selectors\":[\"#i6ov7\"],\"style\":{\"border\":\"1px solid #ddd\",\"padding\":\"8px\"}},{\"selectors\":[\"#i8j1k\"],\"style\":{\"border\":\"1px solid #ddd\",\"padding\":\"8px\"}},{\"selectors\":[\"#iczmg\"],\"style\":{\"border\":\"1px solid #ddd\",\"padding\":\"8px\"}},{\"selectors\":[\"#ief0a\"],\"style\":{\"border\":\"1px solid #ddd\",\"padding\":\"8px\"}},{\"selectors\":[\"#iq6vt\"],\"style\":{\"border\":\"1px solid #ddd\",\"padding\":\"8px\"}},{\"selectors\":[\"#iejt6\"],\"style\":{\"border\":\"1px solid #ddd\",\"padding\":\"8px\"}},{\"selectors\":[\"#i8k0a\"],\"style\":{\"border\":\"1px solid #ddd\",\"padding\":\"8px\"}},{\"selectors\":[\"#imhzn\"],\"style\":{\"border\":\"1px solid #ddd\",\"padding\":\"8px\"}},{\"selectors\":[\"#i01b3\"],\"style\":{\"margin\":\"0px 0px 22px 0px\"}},{\"selectors\":[\"#ijxul\"],\"style\":{\"font-family\":\"Arial\",\"margin\":\"29px 0px 0px 0px\"}},{\"selectors\":[\"#iwrol\"],\"style\":{\"font-family\":\"Arial\"}},{\"selectors\":[\"#i6m05\"],\"style\":{\"width\":\"100%\",\"height\":\"100%\"}}],\"pages\":[{\"frames\":[{\"component\":{\"type\":\"wrapper\",\"stylable\":[\"background\",\"background-color\",\"background-image\",\"background-repeat\",\"background-attachment\",\"background-position\",\"background-size\"],\"attributes\":{\"id\":\"my-wrapper\",\"selectable\":false,\"draggable\":false},\"components\":[{\"type\":\"text\",\"attributes\":{\"id\":\"if2u\"},\"components\":[{\"tagName\":\"span\",\"type\":\"text\",\"attributes\":{\"id\":\"inye\"},\"components\":[{\"tagName\":\"span\",\"type\":\"text\",\"attributes\":{\"id\":\"ioio\"},\"components\":[{\"tagName\":\"font\",\"type\":\"text\",\"attributes\":{\"color\":\"#544c4c\",\"id\":\"iepi\"},\"components\":[{\"type\":\"textnode\",\"content\":\"Uuality of experience: It aims to play the best possible quality without any re-buffering. Unsupported codecs and undecipherable qualities (e.g. higher qualities with more drastic DRM conditions on untrusted devices) are automatically filtered out, even if this happens during playback. The player is also very resilient: any temporary network issue, fall in bandwidth, poorly-packaged content or platform quirk should be properly handled with the main goal of avoiding playback interruption. Portability: The RxPlayer has been ported to a lot of devices, some on the lower-end of performance and memory capabilities and others on the higher end. As such, it can adapt to important memory and performance constraints while still being able to retain its many features. Configurability: The RxPlayer has a plethora of options to let you tweak its behavior. You should be able to play any content the way you want, on any device.\"}]}]}]}]},{\"type\":\"video\",\"resizable\":{\"ratioDefault\":1},\"style\":\"\",\"attributes\":{\"allowfullscreen\":\"allowfullscreen\",\"id\":\"iynr\"},\"src\":\"http://dev-progra.com/pdriver/2023-08-20-01-11-26-6725a36975c46.mkv\",\"sources\":[]},{\"tagName\":\"blockquote\",\"type\":\"text\",\"attributes\":{\"id\":\"ilin9\"},\"components\":[{\"tagName\":\"b\",\"type\":\"text\",\"components\":[{\"tagName\":\"font\",\"type\":\"text\",\"attributes\":{\"color\":\"#3e75c2\",\"id\":\"i5a2g\"},\"components\":[{\"type\":\"textnode\",\"content\":\"To implement the addAttributeToFilter method in your AbstractCollection class and achieve the desired behavior (searching within an entity determined dynamically from the eav_attribute table), you can follow these steps:\"}]}]}]},{\"tagName\":\"h2\",\"type\":\"text\",\"attributes\":{\"id\":\"iohyj\"},\"components\":[{\"tagName\":\"b\",\"type\":\"text\",\"components\":[{\"type\":\"textnode\",\"content\":\"Custom Style Manager\"}]}]},{\"type\":\"two-columns\",\"style\":\"\",\"classes\":[\"row\"],\"attributes\":{\"id\":\"ieoxh\"},\"components\":[{\"content\":\"Column 1\",\"style\":\"\",\"attributes\":{\"id\":\"column-1\"},\"components\":[{\"type\":\"text\",\"attributes\":{\"id\":\"ibe7k\"},\"components\":[{\"type\":\"textnode\",\"content\":\"In case you need a completely custom Style Manager UI (eg. you have to use your UI components), you can create it from scratch by relying on the same sector/propriety architecture or even interfacing directly with selected targets. All you have to do is to indicate the editor your intent to use a custom UI and then subscribe to the style:custom event that will let you know when is the right moment to create/update your UI.\"}]}]},{\"content\":\"Column 2\",\"style\":\"\",\"attributes\":{\"id\":\"column-2\"},\"components\":[{\"type\":\"text\",\"attributes\":{\"id\":\"itaco\"},\"components\":[{\"tagName\":\"b\",\"type\":\"text\",\"attributes\":{\"id\":\"icnjh\"},\"components\":[{\"type\":\"textnode\",\"content\":\"Extends the default component type to include a font-family default style (Tahoma, Geneva, sans-serif). This ensures all components added to the canvas inherit this font-family unless overridden.\"}]}]},{\"type\":\"image\",\"resizable\":{\"ratioDefault\":1},\"attributes\":{\"src\":\"http://dev-progra.com/pdriver/42e27dd3e9434ef597473b8a28abdc5c-6720632c30be9-673d1ed973dbd.png\",\"id\":\"ib4qw\"}},{\"type\":\"image\",\"resizable\":{\"ratioDefault\":1},\"attributes\":{\"alt\":\"unnamed.jpg\",\"src\":\"http://dev-progra.com/pdriver/unnamed-6747a574a988c.jpg\",\"id\":\"i814h\"}}]}]},{\"type\":\"text\",\"attributes\":{\"id\":\"i01b3\"},\"components\":[{\"type\":\"textnode\",\"content\":\"@cimmanon I agree about with you about block level, and I edited my post accordingly. Block level is not required for alignment but may be needed if the user wants to specify height and so on. I took liberty about the browser prefixes, I just assumed a perfect browser for the sake of arriving at a working demo. Thank you again for your comment, appreciate the feedback. –\"}]},{\"tagName\":\"hr\",\"void\":true,\"style\":\"\",\"attributes\":{\"id\":\"iwrol\"}},{\"type\":\"table\",\"droppable\":[\"tbody\",\"thead\",\"tfoot\"],\"style\":\"\",\"attributes\":{\"id\":\"ibqlv\"},\"components\":[{\"type\":\"thead\",\"draggable\":[\"table\"],\"droppable\":[\"tr\"],\"components\":[{\"type\":\"row\",\"draggable\":[\"thead\",\"tbody\",\"tfoot\"],\"droppable\":[\"th\",\"td\"],\"components\":[{\"tagName\":\"th\",\"type\":\"cell\",\"draggable\":[\"tr\"],\"attributes\":{\"id\":\"idkij\"},\"components\":[{\"type\":\"textnode\",\"content\":\"Header 1\"}]},{\"tagName\":\"th\",\"type\":\"cell\",\"draggable\":[\"tr\"],\"attributes\":{\"id\":\"i6ov7\"},\"components\":[{\"type\":\"textnode\",\"content\":\"Header 2\"}]},{\"tagName\":\"th\",\"type\":\"cell\",\"draggable\":[\"tr\"],\"attributes\":{\"id\":\"i8j1k\"},\"components\":[{\"type\":\"textnode\",\"content\":\"Header 3\"}]}]}]},{\"type\":\"tbody\",\"draggable\":[\"table\"],\"droppable\":[\"tr\"],\"components\":[{\"type\":\"row\",\"draggable\":[\"thead\",\"tbody\",\"tfoot\"],\"droppable\":[\"th\",\"td\"],\"components\":[{\"type\":\"cell\",\"draggable\":[\"tr\"],\"attributes\":{\"id\":\"iczmg\"},\"components\":[{\"type\":\"textnode\",\"content\":\"Row 1 Col 1\"}]},{\"type\":\"cell\",\"draggable\":[\"tr\"],\"attributes\":{\"id\":\"ief0a\"},\"components\":[{\"type\":\"textnode\",\"content\":\"Row 1 Col 2\"}]},{\"type\":\"cell\",\"draggable\":[\"tr\"],\"attributes\":{\"id\":\"iq6vt\"},\"components\":[{\"type\":\"textnode\",\"content\":\"Row 1 Col 3\"}]}]},{\"type\":\"row\",\"draggable\":[\"thead\",\"tbody\",\"tfoot\"],\"droppable\":[\"th\",\"td\"],\"components\":[{\"type\":\"cell\",\"draggable\":[\"tr\"],\"attributes\":{\"id\":\"iejt6\"},\"components\":[{\"type\":\"textnode\",\"content\":\"Row 2 Col 1\"}]},{\"type\":\"cell\",\"draggable\":[\"tr\"],\"attributes\":{\"id\":\"i8k0a\"},\"components\":[{\"type\":\"textnode\",\"content\":\"Row 2 Col 2\"}]},{\"type\":\"cell\",\"draggable\":[\"tr\"],\"attributes\":{\"id\":\"imhzn\"},\"components\":[{\"type\":\"textnode\",\"content\":\"Row 2 Col 3\"}]}]}]}]},{\"type\":\"code\",\"style\":\"\",\"attributes\":{\"id\":\"ijxul\",\"language\":\"php\"},\"codeContent\":\"<?php\\n/*\\n * Copyright © ProgramCMS. All rights reserved.\\n * See COPYING.txt for license details.\\n *\\n * Developed by Mohamed EL QUCHIRI <elquchiri@gmail.com>\\n */\\n\\nnamespace ProgramCms\\\\PostBundle\\\\Model\\\\Collection;\\n\\nuse ProgramCms\\\\CoreBundle\\\\Model\\\\Db\\\\Collection\\\\AbstractCollection;\\nuse ProgramCms\\\\PostBundle\\\\Entity\\\\PostEntity;\\n\\n/**\\n * Class Collection\\n * @package ProgramCms\\\\PostBundle\\\\Model\\\\Collection\\n */\\nclass Collection extends AbstractCollection\\n{\\n    /**\\n     * Initialize Post Collection\\n     */\\n    protected function _construct()\\n    {\\n        $this->_initEntity(PostEntity::class);\\n    }\\n}\",\"codeOutput\":\"&lt;?php\\n/*\\n * Copyright © ProgramCMS. All rights reserved.\\n * See COPYING.txt for license details.\\n *\\n * Developed by Mohamed EL QUCHIRI &lt;elquchiri@gmail.com&gt;\\n */\\n\\nnamespace ProgramCms\\\\PostBundle\\\\Model\\\\Collection;\\n\\nuse ProgramCms\\\\CoreBundle\\\\Model\\\\Db\\\\Collection\\\\AbstractCollection;\\nuse ProgramCms\\\\PostBundle\\\\Entity\\\\PostEntity;\\n\\n/**\\n * Class Collection\\n * @package ProgramCms\\\\PostBundle\\\\Model\\\\Collection\\n */\\nclass Collection extends AbstractCollection\\n{\\n    /**\\n     * Initialize Post Collection\\n     */\\n    protected function _construct()\\n    {\\n        $this-&gt;_initEntity(PostEntity::class);\\n    }\\n}\"},{\"type\":\"video\",\"resizable\":{\"ratioDefault\":1},\"style\":\"\",\"attributes\":{\"allowfullscreen\":\"allowfullscreen\",\"id\":\"i6m05\"},\"src\":\"http://dev-progra.com/pdriver/skiboard-673a6f1e0c00d.mp4\",\"sources\":[]}]},\"id\":\"YX26rpHfq03Bta6x\"}],\"id\":\"C2pkA4QGMtPjU7iS\"}]}');
